iterations.yara_rule:
rule Bypass_Sample
{
    meta:
        description = "Evasion bypass patterns targeting ExitProcess"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 8B FF 55 8B EC 38 E7 F6 } // Target: E8C8FFFFFF
        $pattern1 = { 8B FF 55 8B E7 F6 E8 C8 } 
        $pattern2 = { 8B FF 55 8B E7 F6 E8 CE }

    condition:
        any of them
}

